import Header from './fronPage/Head';
import './App.css';
import {BrowserRouter as Router,Route,Routes} from "react-router-dom";
import Navbar from './fronPage/navbar/navbar';
import Footer from "./fronPage/footer/Footer"

function App() {
  return (
    <>
    <Router>
      <Navbar/>
      <Routes>
     <Header/>
    </Routes>
    <Footer/>
    </Router>
    </>
  );
}

export default App;
